-- > div ! wmode "bar" $ "Hello."
--
-- Result:
--
-- > <div wmode="bar">Hello.</div>
--
wmode :: AttributeValue  -- ^ Attribute value.
      -> Attribute ev    -- ^ Resulting attribute.
wmode = attribute "wmode" " wmode=\""
{-# INLINE wmode #-}
